import {useState} from 'react'

function input (){
    const [text,setText] = useState(0)


    function onch(event) {
        const t = event.target.value
        setText(t)
    }



    return(
        <div>
            <br></br>
            <from>
                <input onChange={onch} type="text"></input>
                <button> ok </button>
            </from>

            <ul>
                <li>{text}</li>
            </ul>
        </div>
        
        
    )

}


export default input;
